import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Chores extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <Link to="/">
            <div className="col-2">
              <div className="tile">
                <div>Click to</div>
                <div class="tile-icon">
                  <i class="fas fa-home"></i>
                </div>
                <div>Go Home</div>
              </div>
            </div>
          </Link>
        </div>
      </div>
    );
  }
}

export default Chores;
